		//פונקציה לחישוב זמן מענה המשחק
		function time() {
			myclock = new createjs.Text();
			stage.addChild(myclock);
			myclock.x = 160;
			myclock.y = 100;
			myclock.color = "black";
			myclock.font = "40px ariel";
			min = 0;
			sec = 0;
			check = 0;
			myInterval = setInterval(myInter, 1000);
			myclock.visible = false;
		}
		// פונקציה לאינטרבל של הזמן
		function myInter() {
			if (sec == 60) {
				min++;
				sec = 0;
				check = 0;
			}
			if (sec < 10) {
				sec = "0" + sec;
			}
			if (min < 10) {
				if (check == 0) {
					min = "0" + min;
					check = 1;
				}
			} else {
				check = 0;
			}
			myclock.text = min + ":" + sec;
			sec++;
		}
